// src/App.js
import { BrowserRouter as Router, Route, NavLink, Outlet } from "react-router-dom";
import React from 'react';
import SimpleQuestion from "./SimpleQuestion";
import CompatibilityTab from "./CompatibilityTab";
import Logo from './logo.svg';
import "./App.css";

const Header = () => {
  return (
    <header className="App-header">
      <img src={Logo} className="App-logo" alt="logo" />
      <h1>Voiance</h1>
      <nav className="Navigation">
        <ul className="ListNav">
          <li>
            <NavLink className="linkNav" activeClassName="activeLink" to="/">
              Accueil
            </NavLink>
          </li>
          <li>
            <NavLink className="linkNav" activeClassName="activeLink" to="/CompatibilityTab">
              Compatibilit√©
            </NavLink>
          </li>
          <li>
            <NavLink className="linkNav" activeClassName="activeLink" to="/SimpleQuestion">
              Question simple
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
};

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Outlet>
          <Route path="/CompatibilityTab" element={<CompatibilityTab />} />
          <Route path="/SimpleQuestion" element={<SimpleQuestion />} />
        </Outlet>
      </div>
    </Router>
  );
}

export default App;
